import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, Grid, Typography, Container } from '@material-ui/core';
import { withTranslation } from 'react-i18next';
import stylePage from './style';
import Header from '../../components/header';
import { InputPrestamo } from '../../components/custominput';

class LandingPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isAuth: this.props.isAuth,
      openAlert: false,
      referral: '',
    };
  }

  componentDidMount() {
    const query = new URLSearchParams(this.props.location.search);
    const referral = query.get('r') || 71249383;
  }

  handleAlertClose() {
    this.setState({ openAlert: false });
  }

  render() {
    const { classes, t } = this.props;

    return (
      <>
        <Header />
        <Container>
          <Grid className={classes.container}>
            <div className={classes.cardTitle}>
              <Typography component='h1'>Insira seus Dados</Typography>
            </div>
            <div className={classes.cardInputs}>
              <InputPrestamo placeholder='Informe seu CPF' width='49%' />
              <InputPrestamo placeholder='Informe o numero do seu cartao' width='49%' />
            </div>
            <div className={classes.cardInputs}>
              <InputPrestamo placeholder='Informe o numero CVV' width />
            </div>
          </Grid>
        </Container>
      </>
    );
  }
}

export default withRouter(withStyles(stylePage)(withTranslation()(LandingPage)));
